origin.script:
'use strict';

/**
 * @param {Vec3} value - for property 'origin'
 * @return {Vec3} - update current property value
 */
let AnimationNameF4 = 'F4Move';
let AnimationNameF3 = 'F3Move';
let AnimationNameF2 = 'F2Move';
let AnimationNameB1 = 'B1Move';

let curstateF4 = 1; // 1 = UP 0 = NOR -1 = DOWN
let curstateF3 = 1;
let curstateF2 = 1;
let curstateB1 = 1;

let nextstate;
let StartFrame = 0;

export function animationEvent(event, value) {
	if (event.name == 'Change') {
		//thisScene.getLayer('Finger').play();
		thisLayer.getAnimation(AnimationNameF4).pause();
		console.log("animation stop!");
	}
}
/**
 * @param {Vec3} value - for property 'origin'
 * @return {Vec3} - update current property value
 */
export function choose (curstate){
	let R = Math.random();
	let flag = thisScene.getLayer("Buttonin").visible;
	nextstate = (R > 0.333) ? ((R > 0.666) ? -1 : 0) : 1;
	switch(curstate){
		case 1: // UP
			if(nextstate == 1 || flag == false) StartFrame = 0; //UP
			else if (nextstate == 0) StartFrame = 820; //NOR
			else StartFrame = 1640; //DOWN
			break;
		case 0: // NOR
			if (nextstate == 0 || flag == false) StartFrame = 3280; //NOR
			else if(nextstate == 1) StartFrame = 2460; //UP
			else StartFrame = 4100; //DOWN
			break;
		case -1: // DOWN
			if (nextstate == -1 || flag == false) StartFrame = 6560; //DOWN
			else if(nextstate == 1) StartFrame = 4920; //UP
			else if (nextstate == 0) StartFrame = 5740; //NOR
			break;
	}
	return;
}
export function update(value) {
	if(thisLayer.getAnimation(AnimationNameF4).isPlaying() == false){
		let flag = thisScene.getLayer("Buttonin").visible;
		choose(curstateF4);
		console.log(" curstate is " + curstateF4 + " nextstate is "+ nextstate + " starting frame is " + StartFrame);
		if(flag) curstateF4 = nextstate;
		thisScene.getAnimation(AnimationNameF4).setFrame(StartFrame);
		choose(curstateF3);

		console.log(" curstate is " + curstateF3 + " nextstate is "+ nextstate + " starting frame is " + StartFrame);
		if(flag) curstateF3 = nextstate;
		thisScene.getAnimation(AnimationNameF3).setFrame(StartFrame);

		choose(curstateF2);
		console.log(" curstate is " + curstateF2 + " nextstate is "+ nextstate + " starting frame is " + StartFrame);
		if(flag) curstateF2 = nextstate;
		thisScene.getAnimation(AnimationNameF2).setFrame(StartFrame);

		choose(curstateB1);
		console.log(" curstate is " + curstateB1 + " nextstate is "+ nextstate + " starting frame is " + StartFrame);
		if(flag) curstateB1 = nextstate;
		thisScene.getAnimation(AnimationNameB1).setFrame(StartFrame);

		thisScene.getAnimation("YesodMove").setFrame(0);
		thisScene.getAnimation("HodMove").setFrame(0);
		thisScene.getAnimation("NetzachMove").setFrame(0);
		thisScene.getAnimation("BGMove").setFrame(0);
		thisScene.getAnimation(AnimationNameF4).play();
		thisScene.getAnimation(AnimationNameF3).play();
		thisScene.getAnimation(AnimationNameF2).play();
		thisScene.getAnimation(AnimationNameB1).play();

	}
	return value;
}

