visible.script:
'use strict';

/**
 * @param {Boolean} value - for property 'visible'
 * @return {Boolean} - update current property value
 */
let flag = 1;

export function cursorClick(event) {
	thisScene.getLayer("Finger").play();
	if(flag == 1){
		flag = 0;
		thisScene.getLayer("Buttonin").visible = false;
	}
	else {
		flag = 1;
		thisScene.getLayer("Buttonin").visible = true;
	}
}
